You are NOT READY Naperville!

@effineggnaperville has finally opened its doors downtown 🥚🍳 It’s about time someone brought an epic and massive menu of breakfast sandwiches, waffles, thick pancakes and even brisket tacos to our grab-n-go scene. We loved everything we tried but the standout was 100% the Dirty Papas curly fries in queso and gravy 🤤

Have you made it to Effin’ Egg yet? What should we order there next?
